import React, { FC } from "react";
import Step from "../Step/Step";

interface InstructionsListProps {
  steps: string[];
}

const InstructionsList: FC<InstructionsListProps> = ({ steps }) => (
  <ol data-testid="InstructionsList">
    {steps.map((step) => (
      <Step text={step}></Step>
    ))}
  </ol>
);

export default InstructionsList;
